import './NavBar.scss';
import React from 'react';

function NavBar(props) {
  return (
    <nav className="navbar">
      <p className="navbar__title">Checkmate</p>
      <div className="toggle">
        <div className="toggle__dial"></div>
      </div>
    </nav>
  );
}

export default NavBar;
